webpackJsonp([0xbb66be0d5a19],{7667:function(e,a){e.exports={data:{post:{html:"<p>We're back in Germany, in body if not yet in spirit. The brain takes a couple of days to catch up.</p>\n<p>Our return with Northwest Airlines was a mixed bag. Internet check-in and seat selection is cool. Flying 25-year-old DC-10s in this day and age is not. We arrived 3 hours before take-off, taking the travel advisories into consideration, but despite the warnings ecurity was so fast we ended up consuming liquids in the airport bar for 2 hours before boarding.</p>",fields:{title:"Back Again",date:"18 Aug 2006",url:"https://papascott.de/2006-08-18-back-again/"}}},pathContext:{slug:"/2006-08-18-back-again/",prev:{fields:{title:"My Brother Dave",date:"11 Aug 2006",slug:"/2006-08-11-my-brother-dave/"}},next:{fields:{title:"Ciao Bella Open Air",date:"19 Aug 2006",slug:"/2006-08-19-ciao-bella-open-air/"}}}}}});
